import React from 'react';
import {NavLink} from "react-router-dom";
import styles from './MenuBarLink.module.scss';

const MenuBarLink = ({path, name}) => {
    console.log('======================');
    console.log('name');
    console.log(name);
    console.log('======================');
    return (
        <NavLink to={path}>
            <ul className={styles.ul}>
                <li className={styles.li}>
                    <span>{name}</span>
                </li>
            </ul>
        </NavLink>

    );
};

export default MenuBarLink;
